# + [markdown] id="WRKJYKpYbfcm"
# ### K-Means를 이용한 붓꽃(Iris) 데이터 셋 Clustering

# + [markdown] id="CFT5mX2Ybfco"
# K-means는 군집화에서 가장 일반적으로 사용되는 알고리즘.    
# 군집 중심점이라는 특정한 임의의 지점을 선택해 해당 중심에 가장 가까운 포인트들을 선택하는 군집화 기법.   
# ![image.png](data:image/png;base64,)

# + id="-BdarYXDbfcp" outputId="7ae3637a-97e5-4b5a-91ae-4c52ec6193a6"
from sklearn.preprocessing import scale
from sklearn.datasets import load_iris
from sklearn.cluster import KMeans
import matplotlib.pyplot as plt
import numpy as np
import pandas as pd

iris = load_iris()
# 보다 편리한 데이터 Handling을 위해 DataFrame으로 변환
irisDF = pd.DataFrame(data=iris.data, columns=['sepal_length','sepal_width','petal_length','petal_width'])
irisDF.head(3)

# + id="66-AMXCebfcq"
kmeans = KMeans(n_clusters=3, init='k-means++', max_iter=300,random_state=0).fit(irisDF)

# + id="6r0BFsfibfcr" outputId="550b0e96-8e4e-4b51-f62f-c1ab4a6fca75"
print(kmeans.labels_)

# + id="A_D8AxyRbfcr" outputId="996299b1-c8f3-42ac-ef2e-59e52f7a3a61"
irisDF['target'] = iris.target
irisDF['cluster']=kmeans.labels_
iris_result = irisDF.groupby(['target','cluster'])['sepal_length'].count()
print(iris_result)

# + id="8euhrmgbbfcs" outputId="cbd400f2-a4c6-4f45-d59b-ad3636779f3b"
from sklearn.decomposition import PCA

pca = PCA(n_components=2)
pca_transformed = pca.fit_transform(iris.data)

irisDF['pca_x'] = pca_transformed[:,0]
irisDF['pca_y'] = pca_transformed[:,1]
irisDF.head(3)

# + id="8cX8m2PNbfct" outputId="8aa71ace-74b9-4f44-d84e-0320e6baf7bb"
# cluster 값이 0, 1, 2 인 경우마다 별도의 Index로 추출
marker0_ind = irisDF[irisDF['cluster']==0].index
marker1_ind = irisDF[irisDF['cluster']==1].index
marker2_ind = irisDF[irisDF['cluster']==2].index

# cluster값 0, 1, 2에 해당하는 Index로 각 cluster 레벨의 pca_x, pca_y 값 추출. o, s, ^ 로 marker 표시
plt.scatter(x=irisDF.loc[marker0_ind,'pca_x'], y=irisDF.loc[marker0_ind,'pca_y'], marker='o') 
plt.scatter(x=irisDF.loc[marker1_ind,'pca_x'], y=irisDF.loc[marker1_ind,'pca_y'], marker='s')
plt.scatter(x=irisDF.loc[marker2_ind,'pca_x'], y=irisDF.loc[marker2_ind,'pca_y'], marker='^')

plt.xlabel('PCA 1')
plt.ylabel('PCA 2')
plt.title('3 Clusters Visualization by 2 PCA Components')
plt.show()


# + [markdown] id="wi2PPLFqbfct"
# ### Clustering 알고리즘 테스트를 위한 데이터 생성 

# + id="2USBPtrtbfcu" outputId="7a37c203-1431-4b54-e6ac-bfdd6ab2a756"
import numpy as np
import matplotlib.pyplot as plt
from sklearn.cluster import KMeans
from sklearn.datasets import make_blobs
# %matplotlib inline

X, y = make_blobs(n_samples=200, n_features=2, centers=3, cluster_std=0.8, random_state=0)
print(X.shape, y.shape)

# y target 값의 분포를 확인
unique, counts = np.unique(y, return_counts=True)
print(unique,counts)

# + id="mxW9jHWZbfcu" outputId="c5c4bf2b-3385-4a1c-f1c3-a5d3a767f2d7"
import pandas as pd

clusterDF = pd.DataFrame(data=X, columns=['ftr1', 'ftr2'])
clusterDF['target'] = y
clusterDF.head(3)

# + id="8ggDd2zpbfcv" outputId="23f5e8a6-3474-4edc-c137-6957f913c265"
target_list = np.unique(y)
# 각 target별 scatter plot 의 marker 값들. 
markers=['o', 's', '^', 'P','D','H','x']
# 3개의 cluster 영역으로 구분한 데이터 셋을 생성했으므로 target_list는 [0,1,2]
# target==0, target==1, target==2 로 scatter plot을 marker별로 생성. 
for target in target_list:
    target_cluster = clusterDF[clusterDF['target']==target]
    plt.scatter(x=target_cluster['ftr1'], y=target_cluster['ftr2'], edgecolor='k', marker=markers[target] )
plt.show()

# + id="Qnz9Ncn-bfcv" outputId="e0da694c-d896-4341-c070-bfb99f3bef41"
# KMeans 객체를 이용하여 X 데이터를 K-Means 클러스터링 수행 
kmeans = KMeans(n_clusters=3, 
                init='k-means++', 
                max_iter=200, 
                random_state=0)
cluster_labels = kmeans.fit_predict(X)
clusterDF['kmeans_label']  = cluster_labels

#cluster_centers_ 는 개별 클러스터의 중심 위치 좌표 시각화를 위해 추출
centers = kmeans.cluster_centers_
unique_labels = np.unique(cluster_labels)
markers=['o', 's', '^', 'P','D','H','x']

# 군집된 label 유형별로 iteration 하면서 marker 별로 scatter plot 수행. 
for label in unique_labels:
    label_cluster = clusterDF[clusterDF['kmeans_label']==label]
    center_x_y = centers[label]
    plt.scatter(x=label_cluster['ftr1'], 
                y=label_cluster['ftr2'], 
                edgecolor='k', 
                marker=markers[label] )
    
    # 군집별 중심 위치 좌표 시각화 
    plt.scatter(x=center_x_y[0], y=center_x_y[1], 
                s=200, color='white', alpha=0.9, 
                edgecolor='k', marker=markers[label])
    plt.scatter(x=center_x_y[0],  y=center_x_y[1], 
                s=70, color='k', edgecolor='k', 
                marker='$%d$' % label)

plt.show()

# + id="C6RBPbD6bfcw" outputId="8e7fabcc-fab9-4fae-ba76-00fa2274492a"
print(clusterDF.groupby('target')['kmeans_label'].value_counts())
